import { Redirect, Route } from "react-router";

export default function Authenticated( props ) {

    const RenderSwitch = () => {
        switch ( props.path ) {
            case ( "/" ):
                if ( props.loggedIn ) {
                    return <Redirect to="/frontpage" />
                } else {
                    return <Route path="/" />
                }

            case ( "/access" ):
                if ( props.loggedIn ) {
                    return <Redirect to="/frontpage" />
                } else {
                    return <Route path="/access" />
                }

            case ( "/frontpage" ):
                if ( props.loggedIn ) {
                    return <Redirect to="/frontpage" />
                } else {
                    return <Route path="/access" />
                }

            default:
                return <Redirect to="/access" />
        }
    }

    return (
        <div>
            { RenderSwitch}
        </div>
    )
}
